CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vtie` AS select `tie`.`AlmId` AS `AlmId`,`tie`.`ProCod` AS `ProCod`,`tie`.`ProCan` AS `ProCan`,`tie`.`ProDes` AS `ProDes`,`tie`.`ProCol` AS `ProCol`,`tie`.`ProTNu` AS `ProTNu`,`tie`.`ProTLi` AS `ProTLi`,`tie`.`ProPve` AS `ProPve`,`tie`.`ProPof` AS `ProPof`,`grupos`.`gru_des` AS `gru_des`,`marcas`.`Mar_des` AS `Mar_des` from (((`productos` join `tie` on((`tie`.`ProCod` = `productos`.`Pro_cod`))) join `grupos` on((`productos`.`Gru_id` = `grupos`.`gru_id`))) join `marcas` on((`productos`.`Mar_Id` = `marcas`.`Mar_id`)));

